import React, { useState } from "react";
import "./styles/newTrade.css";
import Modal from "./Modal";
import { showSuccessModal, showUnsuccessModal } from "./Utility";

const NewTrade = ({ setShowModal, fetchRecentTrades }) => {
  const [formData, setFormData] = useState({
    symbol: "",
    option_type: "",
    strike_price: "",
    exp_date: "", // Changed from 'expiration_date'
    entry_price: "",
    exit_price: "",
    contracts: "",
    entry_date: "", // Changed from 'open_date'
    close_date: "", // Changed from 'close_date'
    profit_loss: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const payload = {
        ...formData,
        // Convert empty strings to null for optional fields
        exit_price: formData.exit_price === "" ? null : formData.exit_price,
        close_date: formData.close_date === "" ? null : formData.close_date,
        profit_loss: formData.profit_loss === "" ? null : formData.profit_loss,
      };
      const response = await fetch("http://localhost:8000/trades/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(payload),
      });

      if (!response.ok) {
        throw new Error("Failed to add trade");
      }

      // Reset the form data
      setFormData({
        symbol: "",
        option_type: "",
        strike_price: "",
        exp_date: "",
        entry_price: "",
        exit_price: "",
        contracts: "",
        entry_date: "",
        close_date: "",
        profit_loss: "",
      });
      setShowModal(false);
      showSuccessModal();
      fetchRecentTrades();
    } catch (error) {
      console.error("Error adding trade:", error);
      showUnsuccessModal();
    }
  };

  return (
    <Modal isOpen={setShowModal} onClose={() => setShowModal(false)}>
      <div className="header-card">
        <h2>New Trade</h2>
      </div>
      <form className="new-trade-form" onSubmit={handleSubmit}>
        <label htmlFor="symbol">Symbol:</label>
        <input
          type="text"
          name="symbol"
          value={formData.symbol}
          onChange={handleChange}
          required
        />
        <label htmlFor="optionType">Option Type:</label>
        <input
          type="text"
          name="option_type"
          value={formData.option_type}
          onChange={handleChange}
          required
        />
        <label htmlFor="strikePrice">Strike Price:</label>
        <input
          type="text"
          name="strike_price"
          value={formData.strike_price}
          onChange={handleChange}
          required
        />
        <label htmlFor="expirationDate">Expiration Date:</label>
        <input
          type="date"
          name="expiration_date"
          value={formData.expiration_date}
          onChange={handleChange}
          required
        />
        <label htmlFor="entryPrice">Entry Price:</label>
        <input
          type="text"
          name="entry_price"
          value={formData.entry_price}
          onChange={handleChange}
          required
        />
        <label htmlFor="exitPrice">Exit Price:</label>
        <input
          type="text"
          name="exit_price"
          value={formData.exit_price}
          onChange={handleChange}
        />
        <label htmlFor="contracts">Contracts:</label>
        <input
          type="text"
          name="contracts"
          value={formData.contracts}
          onChange={handleChange}
          required
        />
        <label htmlFor="openDate">Open Date:</label>
        <input
          type="date"
          name="open_date"
          value={formData.open_date}
          onChange={handleChange}
          required
        />
        <label htmlFor="closeDate">Close Date:</label>
        <input
          type="date"
          name="close_date"
          value={formData.close_date}
          onChange={handleChange}
        />
        <input type="submit" value="Add" />
      </form>
    </Modal>
  );
};

export default NewTrade;

